import * as React from "react";

function SvgComp(props) {
  return <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 16 16" {...props}><path className="aw-theme-iconOutline" fill="#464646" d="M10.999 8h5v1h-5zM10.999 10h5v1h-5zM8.999 6h7v1h-7zM7 5H1a1 1 0 00-.858 1.514l3 5a1 1 0 001.716 0l3-5A1 1 0 007 5zm0 2z" /><path fill="#55a0b9" d="M7 6l-3 5-3-5h6" /></svg>;
}
        export const svgString = '<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 16 16">  <rect x="10.9995" y="8" width="5" height="1" class="aw-theme-iconOutline" fill="#464646"/>  <rect x="10.9995" y="10" width="5" height="1" class="aw-theme-iconOutline" fill="#464646"/>  <rect x="8.9995" y="6" width="7" height="1" class="aw-theme-iconOutline" fill="#464646"/>  <path d="M7,5H1A1,1,0,0,0,.1425,6.5145l3,5a1,1,0,0,0,1.715,0l3-5A1,1,0,0,0,7,5ZM7,7H7Z" class="aw-theme-iconOutline" fill="#464646"/>  <polyline points="7 6 4 11 1 6 7 6" fill="#55a0b9"/></svg>';
        export const SvgComponent = React.memo(SvgComp);
